import { combineReducers } from 'redux'
import {switchCase} from "@babel/types";

const initialState = {
  fecha: '1969-01-12',
  bid: 700.00,
  ask: 700.30
}

const update = (state = initialState, action) => {
  if (action.type === 'PUNTA') {
    return {...state, bid: action.bid, ask: action.ask}
  }
  return state
}

export default update
